import React, { Component } from 'react';
import { Form } from 'react-bootstrap';
import { Col } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

class NewContact extends Component {
    constructor(props) {
        super(props);

        // Set component intial state
        this.state = {
            c_firstname: '',
            c_lastname: '',
            c_phone: '',
            c_birthdate: '',
            c_address: ''
        }

        // Bind events
        this.onSubmit = this.onSubmit.bind(this);
    }

    onSubmit(e) {
        // Prevent page reload
        e.preventDefault();

        console.log(`Form submitted:`);
        console.log(`Contact name: ${this.state.c_firstname} ${this.state.c_lastname}`)
    }

    render() {
        return(
            <div className="mt-4">
                <h5 className="mb-4">Create a New Contact</h5>
                <Form onSubmit={this.onSubmit}>
                    <Form.Row>
                        <Form.Group as={Col}>
                            <Form.Label>First Name</Form.Label>
                            <Form.Control type="text" placeholder="First" />
                        </Form.Group>

                        <Form.Group as={Col}>
                            <Form.Label>Last Name</Form.Label>
                            <Form.Control type="text" placeholder="Last" />
                        </Form.Group>
                    </Form.Row>

                    <Form.Row>
                        <Form.Group as={Col}>
                            <Form.Label>Phone</Form.Label>
                            <Form.Control type="text" placeholder="(123) 456-7890" />
                        </Form.Group>

                        <Form.Group as={Col}>
                            <Form.Label>Birthday</Form.Label>
                            <Form.Control type="text" placeholder="YYYY-MM-DD" />
                        </Form.Group>
                    </Form.Row>

                    <Form.Group>
                        <Form.Label>Address</Form.Label>
                        <Form.Control as="textarea" placeholder="1234 Main St" rows="2" />
                    </Form.Group>

                    <Button variant="outline-light mt-4" type="submit">
                        Create
                    </Button>
                </Form>
            </div>
        );
    }
}

export default NewContact;
